'use client';

import { useSearchParams } from 'next/navigation';
import { useEffect, useState, useRef } from 'react';
import { motion, AnimationProps } from 'framer-motion';
import { useTheme } from '@/hooks/useTheme';

// Base64 eyeball SVG for performance - replace with your own creepy images
const DARK_ENTITIES = [
  // SVG eyeball
  `data:image/gif;base64,`,
  // SVG skull
  `data:image/gif;base64,`,
  // SVG pentagram
  `data:image/gif;base64,`,
  // SVG spiderweb corner
  `data:image/gif;base64,`,
  // SVG cracked mirror
  `data:image/gif;base64,`
];

// Number of elements to spawn
const ENTITY_COUNT = 30;
const MIN_DURATION = 20; // Slower movement
const MAX_DURATION = 40; // Much slower for creepiness

interface DarkEntityProps {
  imageUrl: string;
  index: number;
}

// Get a random position for entities
function getRandomPosition() {
  if (typeof window === 'undefined') {
    return { top: '50vh', left: '50vw', scale: 1 };
  }
  
  return {
    top: `${Math.random() * 100}vh`,
    left: `${Math.random() * 100}vw`,
    scale: 0.5 + Math.random() * 1.5,
    rotation: Math.random() * 360
  };
}

// Generate random motion path that's creepy and unsettling
function getRandomPath(): AnimationProps['animate'] {
  if (typeof window === 'undefined') {
    return {
      x: [0, 50, 0, -50, 0],
      y: [0, 20, 50, 20, 0],
      scale: [1, 1.1, 1, 0.9, 1],
      rotate: [0, 10, 0, -10, 0],
    };
  }
  
  // Decide whether this entity should stare at the viewer (track mouse)
  const isTracking = Math.random() > 0.6;
  
  if (isTracking) {
    return {
      // These entities will follow mouse position later
      scale: [1, 1.2, 1.1, 1],
      opacity: [0.7, 0.9, 0.7, 0.8],
    };
  }
  
  // Create subtle, unsettling movement
  const moveX = (Math.random() * 50) - 25;
  const moveY = (Math.random() * 40) - 20;
  const jitter = Math.random() > 0.7;
  
  if (jitter) {
    // Create a jittery, glitchy movement
    return {
      x: [0, moveX/2, moveX*0.8, moveX/4, 0, -moveX/3, 0],
      y: [0, moveY/3, -moveY/2, moveY, moveY/2, 0],
      scale: [1, 1.05, 0.95, 1.03, 1],
      opacity: [0.6, 0.8, 0.6, 0.7, 0.6],
      filter: ["blur(0px)", "blur(0px)", "blur(1px)", "blur(0px)"]
    };
  }
  
  // Smoother, predatory movement
  return {
    x: [0, moveX, moveX*0.8, -moveX/2, 0],
    y: [0, moveY, moveY*1.2, moveY/2, 0],
    scale: [1, 1.1, 1.05, 0.95, 1],
    opacity: [0.6, 0.8, 0.7, 0.6],
    rotate: Math.random() > 0.5 ? [0, 5, 0, -5, 0] : [0, -5, 0, 5, 0],
  };
}

function DarkEntity({ imageUrl, index }: DarkEntityProps) {
  const [initialPosition] = useState(getRandomPosition());
  const [path] = useState(getRandomPath);
  const [isHovered, setIsHovered] = useState(false);
  const [isClicked, setIsClicked] = useState(false);
  const entityRef = useRef<HTMLDivElement>(null);
  
  // Calculate duration between MIN_DURATION and MAX_DURATION
  const duration = MIN_DURATION + Math.random() * (MAX_DURATION - MIN_DURATION);
  const delay = Math.random() * 5;
  
  // Randomize entity appearance
  const invertColor = Math.random() > 0.5;
  const size = 30 + (index % 4) * 15;
  const opacity = 0.4 + Math.random() * 0.6;
  
  // Mouse tracking for some entities
  useEffect(() => {
    const trackMouse = (e: MouseEvent) => {
      if (!entityRef.current || Math.random() > 0.01) return; // Only rarely follow
      
      const rect = entityRef.current.getBoundingClientRect();
      const entityX = rect.left + rect.width / 2;
      const entityY = rect.top + rect.height / 2;
      
      const angleRad = Math.atan2(e.clientY - entityY, e.clientX - entityX);
      const angleDeg = (angleRad * 180) / Math.PI;
      
      entityRef.current.style.transform = `rotate(${angleDeg}deg) scale(${initialPosition.scale})`;
    };
    
    if (Math.random() > 0.7) { // Only some entities track the mouse
      window.addEventListener('mousemove', trackMouse);
    }
    
    return () => window.removeEventListener('mousemove', trackMouse);
  }, [initialPosition.scale]);

  // Handle click - trigger unsettling animation and sound
  const handleClick = () => {
    if (!isClicked) {
      setIsClicked(true);
      
      // Play a random dark sound
      const sounds = [
        '/sounds/whisper.mp3',
        '/sounds/creak.mp3', 
        '/sounds/heartbeat.mp3'
      ];
      
      try {
        const audio = new Audio(sounds[index % sounds.length]);
        audio.volume = 0.2;
        audio.play().catch(() => {});
      } catch (e) {
        console.error('Audio failed to play');
      }
      
      // Reset after animation
      setTimeout(() => setIsClicked(false), 3000);
    }
  };

  return (
    <motion.div
      ref={entityRef}
      className="fixed z-[9999]"
      style={{
        top: initialPosition.top,
        left: initialPosition.left,
        filter: invertColor ? 'invert(1)' : 'none',
        cursor: "crosshair",
        width: `${size}px`,
        height: `${size}px`,
      }}
      initial={{ opacity: 0, rotate: initialPosition.rotation }}
      animate={
        isClicked 
          ? { 
              scale: [1, 2, 0], 
              opacity: [opacity, 1, 0],
              filter: [
                invertColor ? 'invert(1)' : 'none',
                'invert(0) blur(2px) brightness(2)',
                'invert(0) blur(5px)'
              ]
            }
          : {
              ...path,
              opacity: isHovered ? 0.9 : opacity
            }
      }
      transition={
        isClicked 
          ? { 
              duration: 2,
              ease: "anticipate"
            } 
          : {
              duration,
              delay,
              ease: "easeInOut",
              repeat: Infinity,
              repeatType: "reverse",
            }
      }
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
      onClick={handleClick}
      whileHover={{ 
        scale: 1.2,
        filter: invertColor ? 'invert(0.8) sepia(0.5) hue-rotate(30deg)' : 'sepia(0.8) hue-rotate(320deg)',
      }}
    >
      <motion.img
        src={imageUrl}
        alt="Dark Entity"
        style={{ 
          width: '100%', 
          height: '100%',
          filter: 'drop-shadow(0 0 5px rgba(100,0,0,0.7))'
        }}
        animate={isHovered ? { 
          rotate: [0, 15, 0, -15, 0],
        } : {}}
        transition={{ duration: 2 }}
      />
    </motion.div>
  );
}

// Whisper text that appears and fades
function WhisperText() {
  const [position, setPosition] = useState({ x: 50, y: 50 });
  const [currentText, setCurrentText] = useState('');
  
  const whispers = [
    "behind you",
    "don't look now",
    "they're watching",
    "listen closely",
    "never alone",
    "can you feel it?",
    "it sees you",
    "don't sleep",
    "too late",
    "nowhere to hide",
    "the veil thins",
    "always here",
  ];
  
  useEffect(() => {
    const interval = setInterval(() => {
      // Random position on screen
      setPosition({
        x: Math.random() * 80 + 10,
        y: Math.random() * 80 + 10
      });
      
      // Pick a random whisper
      setCurrentText(whispers[Math.floor(Math.random() * whispers.length)]);
    }, 5000); // Show a new whisper every 5 seconds
    
    return () => clearInterval(interval);
  }, []);
  
  return (
    <motion.div
      className="fixed text-red-800 font-serif lowercase z-[9998] pointer-events-none"
      style={{
        left: `${position.x}%`,
        top: `${position.y}%`,
      }}
      initial={{ opacity: 0 }}
      animate={{ opacity: [0, 0.7, 0] }}
      transition={{ duration: 4 }}
    >
      {currentText}
    </motion.div>
  );
}

export default function DarkAbyss() {
  const searchParams = useSearchParams();
  const [isActive, setIsActive] = useState(false);
  const { theme, setTheme } = useTheme();
  const [mousePos, setMousePos] = useState({ x: 0, y: 0 });

  // Create array of dark entities
  const entities = Array(ENTITY_COUNT)
    .fill(null)
    .map((_, i) => ({
      id: i,
      imageUrl: DARK_ENTITIES[i % DARK_ENTITIES.length]
    }));

  useEffect(() => {
    // Only run in browser
    if (typeof window === 'undefined') return;

    const abyssParam = searchParams?.get('abyss');
    setIsActive(abyssParam === 'true');

    if (abyssParam === 'true') {
      // Force dark theme when abyss is active
      setTheme('dark');
      
      // Create ambient dark sound
      const ambient = new Audio('/sounds/ambient.mp3');
      ambient.loop = true;
      ambient.volume = 0.1;
      
      ambient.play()
        .catch(err => console.log('Audio autoplay blocked by browser'));
      
      // Add event listener for mouse movement
      const handleMouseMove = (e: MouseEvent) => {
        setMousePos({
          x: e.clientX,
          y: e.clientY
        });
      };
      
      window.addEventListener('mousemove', handleMouseMove);
      
      // Apply subtle page distortion
      document.body.style.filter = 'contrast(1.05) brightness(0.85)';
      document.body.style.transition = 'filter 2s ease';
      
      return () => {
        // Cleanup
        ambient.pause();
        ambient.currentTime = 0;
        window.removeEventListener('mousemove', handleMouseMove);
        document.body.style.filter = '';
      };
    }
  }, [searchParams, setTheme]);

  if (!isActive) return null;

  return (
    <>
      {/* Dark atmospheric overlay */}
      <div 
        className="fixed inset-0 z-[9996] pointer-events-none bg-black opacity-40"
        style={{
          backgroundImage: 'url("data:image/svg+xml;base64,")',
        }}
      />

      {/* Vignette effect */}
      <div 
        className="fixed inset-0 z-[9997] pointer-events-none"
        style={{
          boxShadow: 'inset 0 0 150px 60px rgba(0, 0, 0, 0.8)'
        }}
      />
      
      {/* Spiderweb corners */}
      <div className="fixed top-0 left-0 w-32 h-32 opacity-50 z-[9997]">
        <img src={DARK_ENTITIES[3]} alt="" />
      </div>
      <div className="fixed top-0 right-0 w-32 h-32 opacity-50 z-[9997] rotate-90">
        <img src={DARK_ENTITIES[3]} alt="" />
      </div>
      <div className="fixed bottom-0 left-0 w-32 h-32 opacity-50 z-[9997] -rotate-90">
        <img src={DARK_ENTITIES[3]} alt="" />
      </div>
      <div className="fixed bottom-0 right-0 w-32 h-32 opacity-50 z-[9997] rotate-180">
        <img src={DARK_ENTITIES[3]} alt="" />
      </div>

      {/* Flickering light effect */}
      <motion.div 
        className="fixed inset-0 z-[9996] pointer-events-none bg-black"
        animate={{ opacity: [0.04, 0.07, 0.03, 0.06, 0.04] }}
        transition={{ 
          duration: 0.5, 
          repeat: Infinity, 
          repeatType: "mirror", 
          ease: "easeInOut",
          times: [0, 0.2, 0.4, 0.7, 1]
        }}
      />
      
      {/* Random whispers */}
      <WhisperText />

      {/* Dark entities */}
      {entities.map(entity => (
        <DarkEntity key={entity.id} imageUrl={entity.imageUrl} index={entity.id} />
      ))}

      {/* Mouse follower */}
      <motion.div
        className="fixed w-40 h-40 rounded-full z-[9995] pointer-events-none"
        style={{
          background: 'radial-gradient(circle, rgba(0,0,0,0) 30%, rgba(80,0,0,0.15) 70%, rgba(0,0,0,0) 100%)',
          left: mousePos.x - 80,
          top: mousePos.y - 80,
        }}
        animate={{ opacity: [0.6, 0.8, 0.6] }}
        transition={{ duration: 2, repeat: Infinity }}
      />
    </>
  );
}